CREATE TABLE `permissions` (
    `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
    `name` varchar(255) NOT NULL,
    `description` varchar(255) DEFAULT NULL,
    `is_active` tinyint(1) NOT NULL DEFAULT 0,
    `need_approval` tinyint(1) NOT NULL DEFAULT 0,
    `reports_to_role_id` int(11) NOT NULL,
    `created_at` timestamp NULL DEFAULT NULL,
    `updated_at` timestamp NULL DEFAULT NULL,
    `role_id` bigint(20) unsigned NOT NULL,
    PRIMARY KEY (`id`),
    KEY `idx_id` (`id`),
    KEY `idx_permissions_role_id` (`role_id`),
    CONSTRAINT `idx_permissions_role_id` FOREIGN KEY (`role_id`) REFERENCES `roles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=721 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci

